<style>
 
/* Header theme button */
header{display:flex;align-items:center;gap:10px;}
.theme-top{margin-left:auto;background:rgba(255,255,255,.15);border:1px solid rgba(255,255,255,.55);color:var(--header-text);padding:8px 12px;border-radius:18px;font-weight:700;cursor:pointer}
body{margin:0;font-family:system-ui,Segoe UI,Roboto,Arial;background:#fff;color:#111}
 header{background:#075e54;color:#fff;padding:12px 16px}
 main{max-width:960px;margin:0 auto;padding:16px}
 .muted{color:#666;font-size:13px}
 .card{border:1px solid #e5e5e5;border-radius:10px;padding:14px;margin:14px 0;box-shadow:0 1px 0 rgba(0,0,0,.05)}
 .ob{font-weight:700;margin:0 0 8px}
 .resp{margin:8px 0 12px;line-height:1.45}
 .gallery{display:grid;grid-template-columns:repeat(auto-fill,minmax(180px,1fr));gap:10px}
 .gallery img{width:100%;height:130px;object-fit:cover;border-radius:8px;background:#fafafa}
 /* Chat styles */
 .app{max-width:820px;margin:0 auto;display:none;flex-direction:column;height:100vh}
 .header{background:#075e54;color:#fff;padding:10px 12px;display:flex;gap:10px;align-items:center}
 .title{font-weight:600}
 .chat{flex:1;overflow:auto;padding:12px;display:flex;flex-direction:column;gap:10px;background:#e5ddd5}
 .bubble{max-width:86%;padding:10px 12px;border-radius:8px;box-shadow:0 1px 0 rgba(0,0,0,.06);line-height:1.3;background:#fff;color:#111}
 .bot{align-self:flex-start;border-top-left-radius:0}
 .user{align-self:flex-end;background:#dcf8c6;border-top-right-radius:0}
 .options{display:flex;flex-wrap:wrap;gap:8px;margin-top:8px}
 .chip{background:#fff;border:1px solid #e0e0e0;padding:8px 10px;border-radius:16px;cursor:pointer}
 .cta{background:#128c7e;color:#fff;border:none;padding:10px 14px;border-radius:18px;font-weight:600;cursor:pointer}
 .carousal,.carousel{display:flex;gap:10px;margin-top:8px;overflow-x:auto;padding-bottom:4px}
 .card2{min-width:200px;background:#fff;border:1px solid #eee;border-radius:10px;padding:10px;box-shadow:0 1px 0 rgba(0,0,0,.05)}
 
.img-actions{display:flex;justify-content:center;padding:8px 0 2px}
.img-share{background:#128c7e;color:#fff;border:none;padding:10px 14px;border-radius:18px;font-weight:700;cursor:pointer}
.img-share:active{transform:scale(.98)}
.card2 img{width:100%;height:140px;object-fit:cover;border-radius:8px;background:#fafafa}
</style>
<style id="copilot-fullbleed-overrides">
html, body { margin:0; padding:0; overflow-x:hidden; -webkit-font-smoothing:antialiased; -moz-osx-font-smoothing:grayscale; font-synthesis-weight:none; text-rendering:optimizeLegibility; font-family: system-ui, "Segoe UI", Roboto, Arial, sans-serif; }
main { max-width:none !important; margin:0 !important; padding:0 !important; }
.app { max-width:none !important; width:100vw !important; margin:0 !important; min-width:0; display:none; flex-direction:column; height:100vh; }
.chat { width:100vw !important; max-width:100vw !important; min-width:0; overflow-x:hidden; overflow-y:auto; padding:16px; background:#e5ddd5; }
.header { padding:12px 16px !important; }
.options{ gap:10px !important; }
.toolbar{ gap:10px !important; }
*, *::before, *::after { box-sizing:border-box; }
@media (min-width:1024px){ .chat{ padding:20px 24px; } .bubble{ max-width:88%; } }
.bubble{ box-shadow:0 1px .5px rgba(0,0,0,.08); border-radius:12px; }
.chip, .chip2{ transition:background .15s ease, transform .08s ease; }
.chip:hover, .chip2:hover{ background:#f2f2f2; }

.btn{ box-shadow:0 1px 0 rgba(0,0,0,.06); }

<style id="copilot-darkmode-overrides">
:root{
  --bg: #e5ddd5;
  --text: #111;
  --header-bg:#075e54;
  --header-text:#fff;
  --bubble-user:#dcf8c6;
  --bubble-bot:#fff;
  --chip-bg:#fff; --chip-border:#e0e0e0; --btn-bg:#128c7e; --btn-text:#fff;
}
body.dark{
  --bg:#121212; --text:#e6e6e6; --header-bg:#0b3d36; --header-text:#e6e6e6;
  --bubble-user:#1f4e46; --bubble-bot:#1a1a1a;
  --chip-bg:#1e1e1e; --chip-border:#333; --btn-bg:#1f6e62; --btn-text:#e6e6e6;
}

.header{ background:var(--header-bg) !important; color:var(--header-text) !important; }
.chat{ background:var(--bg) !important; }
.bubble.bot{ background:var(--bubble-bot) !important; color:var(--text) !important; }

.footer-toolbar{display:flex; gap:8px; flex-wrap:wrap; margin:10px 0 4px 0;}

.theme-toggle{ margin-left:auto; background:transparent; border:1px solid rgba(255,255,255,.6); color:var(--header-text); padding:6px 10px; border-radius:14px; cursor:pointer; }
</style>
<style id="copilot-footer-sticky">
.footer-toolbar{position:sticky; bottom:0; background:transparent; padding:8px 0;}

.footer-inner{display:flex; gap:8px; flex-wrap:wrap; padding:8px; background:rgba(0,0,0,.06); border-radius:10px;}
body.dark .footer-inner{ background:rgba(255,255,255,.08); }

<style id="copilot-safemode">

.safe-ribbon a{ color:inherit; text-decoration:underline; }

<style id="fix-footer-toolbar-fixed">

<script id="vh-fix">(function(){
  console.log('OH share-fix v4 loaded');

  // Ensure Share button always responds, even if Web Share isn't available.
  function openImageInNewTab(img){
    try{
      const url = img.currentSrc || img.src;
      // Open in new tab (works on HTTPS and local). If blocked, fallback to changing location.
      const w = window.open(url, '_blank');
      if(!w){ window.location.href = url; }
    }catch(e){ console.error(e); }
  }
  window.__shareImageOnly = window.__shareImageOnly || (async function(img){ openImageInNewTab(img); });

function setVH(){var vh = window.innerHeight * 0.01; document.documentElement.style.setProperty('--vh', vh + 'px');}
setVH(); window.addEventListener('resize', setVH, {passive:true}); window.addEventListener('orientationchange', setVH, {passive:true});
})();</script>

<!-- CHAT APP (progressive enhancement) -->
<div class="app" id="app">
<div class="chat" id="chat"></div>
</div>
<script>
(function(){
  // If scripts run, hide static and start chat

  function clearFooter(){ var f=document.querySelector('.footer-toolbar'); if(f) f.remove(); }
  function renderFooter(){
    clearFooter();
    var bar=document.createElement('div'); bar.className='footer-toolbar';
    var back=document.createElement('button'); back.className='btn'; back.textContent='â Back';
    back.onclick=function(){ chat.innerHTML=''; addBubble(DATA.defaultMessage); var b=document.createElement('button'); b.className='cta'; b.textContent=DATA.defaultButtonText||'Begin'; b.onclick=function(){ addBubble(DATA.question); addOptions(DATA.options||[]); clearFooter(); attachFooter(); b.remove(); }; var w=document.createElement('div'); w.style.marginTop='8px'; w.appendChild(b); chat.appendChild(w); };
    var reset=document.createElement('button'); reset.className='btn'; reset.textContent='Reset';
    reset.onclick=function(){ chat.innerHTML=''; addBubble(DATA.defaultMessage); var b=document.createElement('button'); b.className='cta'; b.textContent=DATA.defaultButtonText||'Begin'; b.onclick=function(){ addBubble(DATA.question); addOptions(DATA.options||[]); clearFooter(); attachFooter(); b.remove(); }; var w=document.createElement('div'); w.style.marginTop='8px'; w.appendChild(b); chat.appendChild(w); };
    bar.appendChild(back); bar.appendChild(reset);
    chat.appendChild(bar); attachFooter(); chat.scrollTop=chat.scrollHeight;
  }
  // Theme toggle
  (function(){
    var tBtn=document.querySelector('.theme-toggle');
    if(tBtn){
      tBtn.onclick=function(){ document.body.classList.toggle('dark'); try{ localStorage.setItem('ohb_theme', document.body.classList.contains('dark')?'dark':'light'); }catch(e){} };
      try{ var saved=localStorage.getItem('ohb_theme'); if(saved==='dark'){ document.body.classList.add('dark'); } }catch(e){}
    }
  })();

  function ensureFooter(){
    var f=document.querySelector('.footer-toolbar');
    if(!f){ f=document.createElement('div'); f.className='footer-toolbar'; chat.appendChild(f); }
    var inner=f.querySelector('.footer-inner');
    if(!inner){ inner=document.createElement('div'); inner.className='footer-inner'; f.appendChild(inner); }
    return inner;
  }
  function wireHomeFlow(btn){
    btn.onclick=function(){ chat.innerHTML=''; addBubble(DATA.defaultMessage); var b=document.createElement('button'); b.className='cta'; b.textContent=DATA.defaultButtonText||'Begin'; b.onclick=function(){ addBubble(DATA.question); addOptions(DATA.options||[]); attachFooter(); b.remove(); }; var w=document.createElement('div'); w.style.marginTop='8px'; w.appendChild(b); chat.appendChild(w); attachFooter(); };
  }
  function attachFooter(){
    var inner=ensureFooter(); inner.innerHTML='';
    var back=document.createElement('button'); back.className='btn'; back.textContent='â Back';
    var reset=document.createElement('button'); reset.className='btn'; reset.textContent='Reset';
    // Back: go to objection selection
    back.onclick=function(){ chat.innerHTML=''; addBubble(DATA.defaultMessage); var b=document.createElement('button'); b.className='cta'; b.textContent=DATA.defaultButtonText||'Begin'; b.onclick=function(){ addBubble(DATA.question); addOptions(DATA.options||[]); attachFooter(); b.remove(); }; var w=document.createElement('div'); w.style.marginTop='8px'; w.appendChild(b); chat.appendChild(w); attachFooter(); };
    // Reset: go to greeting
    wireHomeFlow(reset);
    inner.appendChild(back); inner.appendChild(reset);

  function addBubble(t, who){ const d=document.createElement('div'); d.className='bubble '+(who||'bot'); d.textContent=t||''; chat.appendChild(d); chat.scrollTop=chat.scrollHeight; return d; }
  function addOptions(options){ const c=document.createElement('div'); c.className='options'; (options||[]).forEach(opt=>{ const b=document.createElement('button'); b.className='chip'; b.textContent=opt.objection; b.onclick=()=>onSelect(opt,c); c.appendChild(b); }); chat.appendChild(c); chat.scrollTop=chat.scrollHeight; }
  function renderInline(objection){
    const list=(DATA.imageMap||{})[objection]||[];
    if(!list.length) return;
    const car=document.createElement('div'); car.className='carousal';
    list.forEach((src,i)=>{
      const card=document.createElement('div'); card.className='card2';
      const img=document.createElement('img');
      img.loading='lazy';
      img.src=src;

<script>
// ===== Share/Download button (links to second page) =====
(function(){
  const chatEl = document.querySelector('.chat');
  if (!chatEl) return;

  // Ensure toolbar exists; if not, create a basic container
  let inner = document.querySelector('.footer-toolbar .footer-inner');
  if (!inner){
    const footer = document.createElement('div');
    footer.className = 'footer-toolbar';
    footer.innerHTML = '<div class="footer-inner">
    <button type="button" class="btn" id="btnBack">Back</button>
    <button type="button" class="btn" id="btnReset">Reset</button>
    <button type="button" class="btn" id="btnShare">Share</button>
</div>';
    chatEl.insertAdjacentElement('afterend', footer);
    inner = footer.querySelector('.footer-inner');
  }

  if (!document.getElementById('btnShare')){
    const btn = document.createElement('button');
    btn.id = 'btnShare';
    btn.className = 'chip btn';
    btn.type = 'button';
    btn.title = 'Share or download the latest image';
    btn.textContent = 'âª Share / Download';
    inner.appendChild(btn);

    function findImageSrc(){
      // Prefer the latest <img> inside the chat area
      const imgs = chatEl.querySelectorAll('img[src]');
      for (let i = imgs.length - 1; i >= 0; i--) {
        const src = imgs[i].getAttribute('src');
        if (src && !src.startsWith('data:application')) return src;
      }
      // Fallback to any static gallery image on the page
      const g = document.querySelector('.gallery img[src]');
      if (g) return g.getAttribute('src');
      return null;
    }

    btn.addEventListener('click', function(){
      const img = findImageSrc();
      const target = 'image_share_bridge.html' + (img ? ('?img=' + encodeURIComponent(img)) : '');
      window.open(target, '_blank', 'noopener');
    });
  }
})();
</script>

<script id="bot-behavior-v1">
(function(){
  const $  = (s, r=document) => r.querySelector(s);
  const $$ = (s, r=document) => Array.from(r.querySelectorAll(s));
  const chat = $('.chat');
  (function(){ const target='Objection Handling Assistant'; const nodes=$$('h1,h2,h3,.title'); let kept=false; nodes.forEach(n=>{ const t=(n.textContent||'').trim(); if(t===target){ if(!kept){ kept=true; } else { n.style.display='none'; } }}); })();
  function scrollToBottom(behavior='smooth'){ if(!chat) return; chat.scrollTo({ top: chat.scrollHeight, behavior }); window.scrollTo({ top: document.body.scrollHeight, behavior }); }
  if (chat){ const obs=new MutationObserver(muts=>{ for(const m of muts){ if(m.addedNodes&&m.addedNodes.length){ setTimeout(()=>scrollToBottom('smooth'),60); break; }}}); obs.observe(chat,{childList:true,subtree:true}); }
  window.addEventListener('load', ()=>scrollToBottom('auto'));
  async function imageToBlob(srcOrImg){ const src=typeof srcOrImg==='string'?srcOrImg:(srcOrImg&&srcOrImg.src)||''; if(!src) throw new Error('No image source'); if(src.startsWith('data:')){ const r=await fetch(src); return await r.blob(); } const r=await fetch(src,{mode:'cors'}); if(!r.ok) throw new Error('Fetch failed: '+src); return await r.blob(); }

async function imageElementToPngBlob(img){
  if(!img) throw new Error('No image element');
  // Ensure the image is loaded
  if(!img.complete){
    await new Promise((resolve,reject)=>{
      img.addEventListener('load', resolve, {once:true});
      img.addEventListener('error', ()=>reject(new Error('Image failed to load')), {once:true});
    });
  }
  const w = img.naturalWidth || img.width || 0;
  const h = img.naturalHeight || img.height || 0;
  if(!w || !h) throw new Error('Invalid image size');
  const canvas = document.createElement('canvas');
  canvas.width = w; canvas.height = h;
  const ctx = canvas.getContext('2d');
  ctx.drawImage(img, 0, 0, w, h);
  const blob = await new Promise(res=>canvas.toBlob(res, 'image/png', 0.92));
  if(!blob) throw new Error('PNG conversion failed');
  return blob;
}
  function downloadBlob(blob,name='image.png'){ const url=URL.createObjectURL(blob); const a=document.createElement('a'); a.href=url; a.download=name; a.rel='noopener'; document.body.appendChild(a); a.click(); a.remove(); setTimeout(()=>URL.revokeObjectURL(url),1000); }
  function lastBotBubble(){ const bots=$$('.chat .bubble.bot'); return bots.length?bots[bots.length-1]:null; }
  function lastImage(){ const c=$$('.chat img'); if(c.length) return c[c.length-1]; const g=$$('.gallery img'); if(g.length) return g[g.length-1]; return null; }
  function safeName(n,f='image.png'){ const s=(n||'').split('?')[0].replace(/[^\w.-]+/g,'_'); return s||f; }
  document.addEventListener('click', async (e)=>{ const img=e.target.closest('.gallery img, .chat img'); if(!img) return; if(e.metaKey||e.ctrlKey){ $$('.gallery img.selected, .chat img.selected').forEach(el=>el.classList.remove('selected')); img.classList.add('selected'); return; } try{ const blob=await imageToBlob(img); const nm=safeName(img.alt)||safeName((img.src||'').split('/').pop()); downloadBlob(blob,nm||'image.png'); }catch(err){ console.error(err); alert('Could not download this image (CORS).'); } });
  async function handleShare(){
    const sel = $('.gallery img.selected, .chat img.selected');
    const img = sel || lastImage();
    if(!img){ alert('No image found to share.'); return; }
    try{
      const blob = await imageToBlob(img);
      const file = new File([blob], safeName((img.alt||'final')+'.png'), {type: blob.type||'image/png'});

      // Share ONLY the image file (no text/caption)
      if(navigator.canShare && navigator.canShare({files:[file]})){
        await navigator.share({ files:[file] });
        return;
      }

      // Fallback: download image for manual sharing (no caption)
      const nm = safeName((img.alt||'final')+'.png');
      downloadBlob(blob, nm);
      alert('Direct share is not supported in this browser. The image was downloadedâshare it from WhatsApp/Gallery (no caption will be added).');
    }catch(err){
      console.error(err);
      alert('Share failed. Try opening in Chrome (not in-app browser). If it still fails, use Download image and share from WhatsApp/Gallery.');
    }
  }
  async function handleDownload(){ const sel=$('.gallery img.selected, .chat img.selected'); const img=sel||lastImage(); if(!img){ alert('No image found to download.'); return; } try{ const blob=await imageToBlob(img); const nm=safeName(img.alt)||safeName((img.src||'').split('/').pop()); downloadBlob(blob,nm||'image.png'); }catch(err){ console.error(err); alert('Could not download this image.'); } }
  const botStack=[]; let baselineIndex=0;
  function computeBaseline(){ if(!chat) return; const begin=Array.from(chat.querySelectorAll('button, .cta')).find(b=>/yes\s*!!?\s*let\s*'?s\s*begin/i.test((b.textContent||''))); if(begin){ const base=begin.closest('.bubble'); if(base) baselineIndex=Array.from(chat.children).indexOf(base); } else baselineIndex=0; }
  computeBaseline();
  if(chat){ const stackObs=new MutationObserver(muts=>{ muts.forEach(m=>{ m.addedNodes&&m.addedNodes.forEach(n=>{ if(n.nodeType===1 && n.classList&&n.classList.contains('bubble')&&n.classList.contains('bot')) botStack.push(n); }); }); }); stackObs.observe(chat,{childList:true}); }
  function handleBack(){ if(!chat) return; let last=botStack.pop(); if(!last){ const kids=Array.from(chat.children); for(let i=kids.length-1;i>=0;i--){ const n=kids[i]; if(n.classList&&n.classList.contains('bubble')&&n.classList.contains('bot')){ last=n; break; } } } if(!last) return; const idx=Array.from(chat.children).indexOf(last); if(idx<=baselineIndex) return; const toRemove=[last]; let next=last.nextElementSibling; while(next && !(next.classList.contains('bubble')) && !(next.classList.contains('footer-toolbar'))){ toRemove.push(next); next=next.nextElementSibling; } toRemove.forEach(n=>n.remove()); setTimeout(()=>scrollToBottom('smooth'),50); }
  const initialChatHTML = chat ? chat.innerHTML : '';
  function handleReset(){ if(chat) chat.innerHTML=initialChatHTML; $$('.gallery img.selected, .chat img.selected').forEach(el=>el.classList.remove('selected')); botStack.length=0; computeBaseline(); window.scrollTo({top:0, behavior:'smooth'}); }
  (function(){ const bars=$$('.footer-toolbar'); if(bars.length>1){ for(let i=1;i<bars.length;i++) bars[i].remove(); } })();
  window.__shareImageOnly = async function(img){
  if(!img){ alert('No image found to share.'); return; }

  // Web Share requires secure context (https) on most Android browsers.
  if(!window.isSecureContext){
    try{
      // Fallback: download so user can share manually
      let blob;
      try{ blob = await imageElementToPngBlob(img); }
      catch(e){ blob = await imageToBlob(img); }
      const fileName = safeName((img.alt||'final')+'.png');
      downloadBlob(blob, fileName);
      alert('Direct share needs HTTPS. This page was opened as a local file (content:// or file://). The image is downloadedâshare it from WhatsApp/Gallery.');
    }catch(err){
      console.error(err);
      alert('Share is blocked because this page is not HTTPS.');
    }
    return;
  }

  try{
    // Convert to PNG for best compatibility across WhatsApp/Gallery share flows
    let blob;
    try{ blob = await imageElementToPngBlob(img); }
    catch(e){ blob = await imageToBlob(img); } // fallback
    const fileName = safeName((img.alt||'final')+'.png');
    const file = new File([blob], fileName, {type: 'image/png'});

    // Prefer capability check
    if(navigator.canShare && !navigator.canShare({files:[file]})){
      // If files can't be shared, download instead
      downloadBlob(blob, fileName);
      alert('This browser cannot share files directly. The image is downloadedâshare it from WhatsApp/Gallery.');
      return;
    }

    // Try native share; if it fails, fall back to download.
    if(navigator.share){
      try{
        await navigator.share({ files:[file] });
        return;
      }catch(shareErr){
        console.error('navigator.share failed:', shareErr);
        downloadBlob(blob, fileName);
        alert('Direct share failed in this browser/app. The image is downloadedâshare it from WhatsApp/Gallery.');
        return;
      }
    }

    // No share API
    downloadBlob(blob, fileName);
    alert('Direct share is not supported in this browser. The image is downloadedâshare it from WhatsApp/Gallery.');
  }catch(err){
    console.error(err);
    {
    console.error(err);
    // Last-resort fallback: open image in new tab so user can use browser's native "Share image"
    try{
      const src = img.currentSrc || img.src;
      if(src){
        window.open(src, '_blank', 'noopener');
      }
    }catch(e){}
    alert('Share failed in this browser/app. I opened the image in a new tab. If it still doesn\'t share, tap Download image and share from WhatsApp/Gallery.');
  }
};
  const back=$('#btn-back'), reset=$('#btn-reset'), themeTop=$('#btn-theme-top');
  if(back) back.onclick=handleBack;
  if(reset) reset.onclick=handleReset;
  if(themeTop) themeTop.onclick=()=>document.body.classList.toggle('dark');
})();
</script>
